import React from "react";
import { useState, useMemo, useCallback,useEffect } from "react";
import Bins from "./Bins";
import 'leaflet/dist/leaflet.css';
import { GeoJSON } from "react-leaflet";
import '../css/home.css';
import '../css/map.css';
import { render } from "@testing-library/react";
import { MapContainer, TileLayer, Marker } from 'react-leaflet';

import { useMapEvents } from 'react-leaflet';

function Map() {
  const [position, setPosition] = useState([51.505, 19.09]);

  function handleMoveend(event) {
    setPosition(event.target.getCenter());
    console.log(position);
  }

  return (
    <MapContainer center={position} zoom={13} scrollWheelZoom={true} className="map-container">
      <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" onMove={handleMoveend}/>
      <Bins lat={position[0]} lng={position[1]} />
      {/* {useMapEvents({
        moveend: handleMoveend,
      })} */}
    </MapContainer>
  );
}

export default Map;
